import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className='background' >
      <div>
      <ul>
        <li><a href="default.asp">Home</a></li>
        <li><a href="news.asp">News</a></li>
        <li><a href="contact.asp">Contact</a></li>
        <li><a href="about.asp">About</a></li>
      </ul>
      </div>
    </div>

  );
}

export default App;
